import Foundation

let input = """

"""

let inputArray = Array(input.trimmingCharacters(in: .whitespacesAndNewlines))

func reduction(fromInputArray: [Character]) -> Int {
    var inputArray = fromInputArray
    var indicesToRemove = [Int]()
    var didRemoveAnything = false
    
    repeat {
        didRemoveAnything = false
        var index = 0
        let lastIndex = inputArray.count - 2
        
        repeat {
            if String(inputArray[index]) != String(inputArray[index + 1]) && String(inputArray[index]).lowercased() == String(inputArray[index + 1]).lowercased() {
                indicesToRemove.append(contentsOf: [index, index + 1])
                didRemoveAnything = true
                index += 2
            } else {
                index += 1
            }
        } while index <= lastIndex
        
        for index in indicesToRemove.sorted().reversed() {
            inputArray.remove(at: index)
        }
        
        indicesToRemove.removeAll()
        
    } while didRemoveAnything
    
    return inputArray.count
}

func partOne() -> String {
    let result = reduction(fromInputArray: inputArray)
    return "\(result)"
}

func partTwo() -> String {
    let allInputElements = Set<Character>(Array(input.lowercased()))
    
    let result = allInputElements.map { character -> Int in
        var newInput = inputArray
        newInput.removeAll(where: { String($0).lowercased() == String(character) })
        return reduction(fromInputArray: newInput)
    }.min()!
    
    return "\(result)"
}

print(partOne())
print(partTwo())
